tables.table_schema:
CREATE TABLE ModelMetrics (
    model_id SERIAL PRIMARY KEY,
    model_name VARCHAR(100) NOT NULL,
    training_accuracy FLOAT NOT NULL,
    validation_accuracy FLOAT NOT NULL
);

CREATE TABLE TrainingMetrics (
    training_id SERIAL PRIMARY KEY,
    model_id INT NOT NULL,
    loss FLOAT NOT NULL,
    training_time INT NOT NULL
);

CREATE TABLE ValidationMetrics (
    validation_id SERIAL PRIMARY KEY,
    model_id INT NOT NULL,
    precision FLOAT NOT NULL,
    recall FLOAT NOT NULL
);

CREATE TABLE ModelMetrics (
    model_id INT,
    metric_name VARCHAR,
    metric_value FLOAT,
    timestamp TIMESTAMP
);

CREATE TABLE ModelConfig (
    model_id INT PRIMARY KEY,
    model_name VARCHAR,
    config_json JSON
);

CREATE TABLE ModelLogs (
    log_id INT PRIMARY KEY,
    model_id INT,
    log_message TEXT,
    log_timestamp TIMESTAMP
);

CREATE TABLE ModelResults (
    result_id INT PRIMARY KEY,
    model_id INT,
    result_data JSON,
    result_timestamp TIMESTAMP
);

CREATE TABLE model_metrics (
    model_id INT,
    model_name TEXT,
    test_accuracy FLOAT,
    training_accuracy FLOAT
);

CREATE TABLE training_data (
    model_id INT,
    dataset_name TEXT,
    dataset_size INT,
    training_time FLOAT
);

CREATE TABLE deployment_logs (
    deployment_id INT,
    model_id INT,
    deployed_date TIMESTAMP,
    deployment_status TEXT
);

CREATE TABLE inference_results (
    inference_id INT,
    model_id INT,
    input_data TEXT,
    output_data TEXT
);

CREATE TABLE model_parameters (
    model_id INT,
    parameter_name TEXT,
    parameter_value FLOAT
);
